import React from 'react'
import Item from '../showcase/Item'
import './css/LargeContainer.css'

export default function LargeProjectContainer({image, imageBackgroundColor,title, year, url, description,languages}){
    return (
        <div className="large-project-container-wrapper">
            <Item 
                image={image} 
                url={url} 
                backgroundColor={imageBackgroundColor}
            ></Item>
            <div id="description-wrapper">
                 <h1>{title}</h1>
                 <h1>{year}</h1>
                 <p>{description}</p>
                 <p>{languages}</p>
            </div>
        </div>
    )
}
